Why bc you play both offense and defense and there are huge momentum shifts 

At times you can feel the momentum waning and at this point momentum swings the other way. Even if only temprorary

So what happened here? I think for the most part it was simple supply vs demand dynamics 

We got to the point where there were a lot of new coins launching daily and each one needing more and more liquidity to support it. At one point needed it around 200m a day if new money inflows to support current prices 

So supply overwhelms demand and bc everyone is all in there‚Äôs not enough passive bid and demands in the books or liquidity and we get these violent moves down. 

We reached a point of balance and then the other team took over temporarily. 

It‚Äôs why at key points or where you feel that shift and see that loss of momentum or factors. You play a little more defensive positioning 

Then you are in a position to counter the market and win off others fear. 

This isn‚Äôt the macro top imo. Just a local one. The bull market always ends when supply essentially becomes infinite and there‚Äôs nobody left to buy. We aren‚Äôt there yet imo 

