Here are some comments on back testing a trading approach
As a discretionary trader I view back-testing as a worthless and unreliable means to develop or prove a trading approach. Too easy to subjectively see what might have/have not worked
Proper back-testing is an exhaustive process involving several steps
1. Precision in all components of trade execution - what is a trade, how is it entered, how is it sized, how is it exited, much more
2. In futures, rules must be tested against 067 back-adjusted data for as many mkts as possible. This is called "in-sample" testing and must include tolerance for slippage and fees
3. Then rules must be tested against "out-of-sample" data, preferably in different asset class, as much data as possible
4. Then benchmarks must be developed on key metrics
5. Then at least 200 simulations must be looked at with random sequencer to judge performance profiles within one Stn Dev
Hey you systematic traders, anything to add to this list????', '1783856904982470935.jpg', '', '', False, NULL, False, 4190, 15, 2, 9, 723902, 1069.50, 6.71), (4965, '2024-04-26 13:34:37.000000', 1783852181860368602, 'MacnBTC', 996294856078188544, 'twitter', '@cousincrypt0 answer your tg pls', '', '', '', True, 1783850559709098031, False, 3409, 9, 0, 2, 550017, 493.37, 5.95), (4966, '2024-04-26 13:34:19.000000', 1783852109416276211, 'MacnBTC', 996294856078188544, 'twitter', 'new market participants will never know true pain, what we have now is nothing https://t.co/RqOGsopUFL', '1783852109416276211.jpg', '', '', False, NULL, False, 32120, 218, 9, 44, 550017, 1995.98, 7.33), (4967, '2024-04-26 13:03:14.000000', 1783844285525131704, 'MacnBTC', 996294856078188544, 'twitter', '@ExitLiqCapital Fr', '', '', '', True, 1783843845966356586, False, 2080, 7, 0, 2, 550017, 477.37, 5.92), (4968, '2024-04-26 13:03:06.000000', 1783844251643548122, 'MacnBTC', 996294856078188544, 'twitter', '@fusionistio ü§ù', '', '', '', True, 1783839297172656167, False, 3723, 10, 0, 1, 550017, 495.96, 5.96), (4969, '2024-04-26 13:30:25.000000', 1783851125684179206, 'trader1sz', 2837666919, 'twitter', '@TheCryptoLes @MitchSteds ü§£', '', '', '', True, 1783851060018159911, False, 980, 5, 0, 1, 582240, 488.31, 5.94), (4970, '2024-04-26 13:24:08.000000', 1783849545387909141, 'trader1sz', 2837666919, 'twitter', '@Sprinter00000 @TheCryptoLes @MitchSteds', '', '', '', True, 1783847724011381094, False, 215, 2, 0, 3, 582240, 478.71, 5.92), (4971, '2024-04-26 13:19:55.000000', 1783848481766977907, 'trader1sz', 2837666919, 'twitter', '@coynbayse What‚Äôs that?', '', '', '', True, 1783651756095771108, False, 114, 3, 0, 1, 582240, 476.42, 5.92), (4983, '2024-04-26 14:52:38.000000', 1783871816362041365, 'Anbessa100', 226749344, 'twitter', 'The $BLUAI quest platform is live. Friendly reminder if u have no capital reserves, collect your points for free tokens. Looking forward to add this one to my AI alpha marke