Here are my general checklist for quitting a day job to trade
1. You need to exist on trading skill, not that a market bet will immediately come through for you
2. Account capital -- how much do you need to live on. Multiply this by 5.
3. Account capital should represent profits already bagged, not on a loan or savings or second mortgage on your home. Trading WITH profits proves that you can actually be profitable
4. Have enough $ saved outside trading account to live on for two years
5. Assume that market conditions will be such that you lose money in year 1
6. Paper trade your proposed approach for at least one year to work out details -- it''s the details that will make or break you
8. Know that if you "make it," you will be among the 3-5% that tried
