Kick back and relax, you won‚Äôt miss much', '', '', '', False, NULL, False, 2313, 15, 2, 5, 97168, 192.60, 5.03), (6953, '2024-05-02 18:42:21.000000', 1786103953068797986, 'Pentosh1', 1138993163706753029, 'twitter', 'A lot of people will sell you dreams, and they know they are selling you dreams bc its easy to sell someone on their own dream.', '', '', '', True, 1786102762805092771, False, 13552, 153, 4, 17, 785388, 1152.21, 6.80), (6954, '2024-05-02 18:37:37.000000', 1786102762805092771, 'Pentosh1', 1138993163706753029, 'twitter', 'A few thoughts and expectations. This cycle should have the largest diminishing returns of any cycle. A few reasons for this. The floor prices of the entire market were set pretty high. Each cycle has set a floor about 10x the prev lows in terms of marketcap. Total3 consists of only the top 125 alts so its important to note its not tracking all. When I got into crypto in 2017 it was around 12-15B for alts, and eventually would see over 1T. That growth isn''t repeatable. DeFi was non existent. Today however there are a lot more alts, and a lot more dilution. So at the time, prices could really only go up bc we were early. 2% of Americans or so had crypto at the time, while now over 25% own crypto. It''s improtant bc they are the ones with the money. Bangladeshian adoption doesn''t matter. You certainly can''t 10x the amount of people again with that type of capital. It just requires more capital to move the markets and there will continue to be a lot more alts, spreading it out further. Thus I think it will be a lot more difficult to see those outsized returns. 

As of a few weeks ago at the highs the amount of tokens unlocked, but not necessarily sold was $250m per day. Assuming they all got sold, that is the inflows you''d need just to keep prices stable for 24 hours. One day, those will get sold, but not today. Most are held for now, until they arent. My best guess is that this cycle we don''t see Total 3 go 2x past the 21'' cycle ath. So 2.2T max for total3. It doesn''t mean there aren''t opportunities, bc that isn''t true. There are opps daily. It just means that you are no longer early. We are certainly in the late majority stage. I think peoples expectations should be lowered a bit, and this cycle shouldn''t be compared to past cycle bc of adoption and overall growth in the space is just so much higher. 

I also believe most people never really learn. Bc if you can''t control you greed, and defeat it. You are destined to give back your gains repeatedly. You will always chase your ath, or try to make something back. 

If you believe the cycle is 50% over, you should be taking out more than you are putting in and building up some cash and buying other assets with lower risk in the mean time. This applies to most, but not all people. So you have capital for new opportunities elsewhere or lower.  The last thing you want to be is all in at the end. Your goal, should be to capture 80% of the total bull market. We all aren''t going to make it. Most people won''t, statistically only 1% can ever be in the 1% and most people won''t make it. Your gains are often temporary before moving into the pockets of others on a long enough time frame. The system is mostly designed for you to lose. If you make life changing gains, or have. Secure it. I don''t think people realize the sheer size of the alt space at 10T for example. Or how much it would really take to get there. Protect yourself, when you reach various goals. Then start over with a lower amount at the very minimum

Just something to think about, in terms of where we are, how much growth we''ve had, and what that could mean for future growth and returns. Imo, the best is behind us in terms of easy, outsized gains across the board. But the future is still bright.  Don''t let anyone sell shame you when the time is right for you.', '1786102762805092771.jpg', '', '', False, NULL, False, 56597, 806, 113, 105, 785388, 5652.19, 8.37), (6955, '2024-05-02 18:57:48.000000', 1786107840328790367, 'CryptoCred', 899558268795842561, 'twitter', '@Ninjascalp Yeah, I DCA my entries

