But I am beyond that, I am above reproach

I would never shill BritbongDEX, a lightning-fast DEX built on Solana with parallel execution, danksharding, ZK-proofs, AI indicators, and more', '', '', '', True, 1786330362630525437, False, 1689, 30, 1, 5, 622878, 607.25, 6.16), (7171, '2024-05-03 09:33:06.000000', 1786328119537799665, 'CryptoCred', 899558268795842561, 'twitter', 'There are plenty of traders who make a lot of money with ''basic'' tools (price, Moving Averages, standard momentum indicators et cetera).

More complexity often = more noise, which makes it harder to build a system that you can actually execute in the market.

Unnecessary complexity also introduces a tracking problem. It''s a lot easier to reconcile 1-2 conflicting signals than 4-5 signals all saying different things.

In most cases we''re trying to map broadly similar market effects (trend, momentum, mean reversion, delta imbalance, and so on) - there are no prizes for getting the same answer with fancier working.

Start with simple stuff that you know well, and iterate slowly (if needed).

Complexity and new variables should be added as/if necessary and using the minimum effective dose.

The Moving Average trader with simple(r) entry/exit criteria will have an easier time refining their system than the trader who is looking at OI, funding, quarterly futures basis, CVD, liquidity heatmaps etc. simultaneously while trying to synthesise a single, coherent trade idea.', '', '', '', False, NULL, False, 16986, 263, 36, 52, 622878, 1919.69, 7.30), (8129, '2024-05-06 08:51:36.000000', 1787404838306759059, 'trader1sz', 2837666919, 'twitter', '@CryptoGirl79 @cryptocom Good girl ü§ù', '', '', '', True, 1787404713199129019, False, 43, 1, 0, 2, 583775, 474.40, 6.15), (8130, '2024-05-06 08:47:54.000000', 1787403907703967841, 'trader1sz', 2837666919, 'twitter', '@CryptoGirl79 @cryptocom ü§ù', '', '', '', True, 1787403818415571451, False, 44, 1, 0, 1, 583775, 472.41, 6.15), (8131, '2024-05-06 08:37:58.000000', 1787401405356994991, 'trader1sz', 2837666919, 'twitter', '@AltCryptoGems @cryptocom List @KittenHaimer $KHAI and I will make sure you get tons of new users and will join myself .', '', '', '', True, 1787395838517375217, False, 2320, 166, 103, 54, 583775, 1387.18, 7.15), (8132, '2024-05-06 08:28:18.000000', 1787398975198285876, 'trader1sz', 2837666919, 'twitter', '@UreshP And I have no issue with differing views.

